            {launchs.auto_update === true ? "true" : null}
          </small>
        </h4>
        <div className="row">
          <div className="col-sm-6">
            <p>Type : {}</p>
            <p>Crew : {}</p>
            <p>Dray Mass :{}kg</p>
            {/* <p className={props.active === true ? "text-success" : "text-danger"}>
            {props.active === true ? "active" : null}
          </p> */}
            {/* <p>Return Payload Mass: {props.return_payload_mass} kg</p> */}
            <button type="button" className="btn btn-outline-light btn-md">
              wikipedia
            </button>
          </div>
          <div className="col-sm-6">
            <p className="h6">Heat sheild deatil</p>
            <p>Materail:{}</p>
            <p>size : {}m</p>
            <p>Temprature:{} degree</p>
            <p>Dev partner : {}</p>
            <div>
              <h6>Other Deatil:</h6>
              <p>Launch Payload Mass : {}</p>
              <p>Presssurize Capsule Payload Volume : {} meter cube</p>
            </div>
          </div>
        </div>
        <div className="row">
<div className="col-sm-6">
<img className="img-fluid" />
</div>
        </div>
        <div>
          <p calssName="h7 text-start">{}</p>
        </div>
      </div>
    </div>
  );
};

export default SingleLaunch;
